import React from "react";
import { makeStyles } from "@mui/styles";
import image from "../../../assets/images/header_background.png";
import { Typography } from "@mui/material";

const useStyles = makeStyles((theme) => ({
  root: {
    backgroundColor: "#00B0EF",
  },
  header: {
    height: "96vh",
    backgroundImage: "url(" + image + ")",
    backgroundRepeat: "no-repeat",
    backgroundSize: "cover",
    display: "flex",
    flexDirection: "column",
    justifyContent: "center",
    alignItems: "center",
  },
  container: {
    display: "flex",
    flexDirection: "column",
  },
  rowEnd: {
    display: "flex",
    flexDirection: "column",
    justifyContent: "end",
    alignItems: "end",
  },
}));

const About = () => {
  const classes = useStyles();

  return (
    <div>
      <div className={classes.header}>
        <div style={{ marginTop: -36, backgroundColor: "red" }}>
          <Typography fontSize={50} fontWeight={"700"}>
            About Us
          </Typography>
          <Typography textAlign={"center"} maxWidth={100}>
            To bring positive change to the Rivers State healthcare value chain.
          </Typography>
        </div>
      </div>
    </div>
  );
};

export default About;
